import logo from './logo.svg';
import './App.css';

let sum = 0;
for(let num of [1,2,3,4,5]) {
  sum += num;
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
          <h1>
            Coin Exchange {sum}
          </h1>
      </header>
    </div>
  );
}

export default App;
